--  DDL for Trigger TRIG_ASIGNAR_AGENTE
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "PROYECTO"."TRIG_ASIGNAR_AGENTE" 
BEFORE INSERT ON RESERVA
FOR EACH ROW
DECLARE
    id_agente_aleatorio NUMBER;
BEGIN
    -- Seleccionar un ID_AGENTE aleatorio de la tabla AGENTE
    SELECT ID_AGENTE
    INTO id_agente_aleatorio
    FROM (
        SELECT ID_AGENTE
        FROM AGENTE
        ORDER BY DBMS_RANDOM.VALUE
    )
    WHERE ROWNUM = 1;

    -- Asignar el ID_AGENTE aleatorio a la nueva fila de RESERVA
    :NEW.ID_AGENTE := id_agente_aleatorio;
END;
/
ALTER TRIGGER "PROYECTO"."TRIG_ASIGNAR_AGENTE" ENABLE;
--------------------------------------------------------
--  DDL for Trigger TRIGGER_GENERAR_NOMBRE_RESERVA
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "PROYECTO"."TRIGGER_GENERAR_NOMBRE_RESERVA" 
BEFORE INSERT ON RESERVA
FOR EACH ROW
DECLARE
    contador INTEGER;
    nuevo_nombre VARCHAR2(255);
BEGIN
    -- Obtener el número actual de reservas
    SELECT COALESCE(MAX(TO_NUMBER(REGEXP_REPLACE(nombre_Reserva, '[^0-9]', ''))), 200) + 1 INTO contador FROM RESERVA;
    -- Incrementar el contador si es menor que 201
    IF contador < 201 THEN
        contador := 201;
    END IF;
    -- Crear el nuevo nombre de reserva concatenando "Reserva" y el contador
    nuevo_nombre := 'Reserva' || contador;
    -- Asignar el nuevo nombre de reserva al campo nombre_Reserva
    :NEW.nombre_Reserva := nuevo_nombre;
END;
/
ALTER TRIGGER "PROYECTO"."TRIGGER_GENERAR_NOMBRE_RESERVA" ENABLE;
--------------------------------------------------------
--  DDL for Trigger TRIG_ID_CLIENTE
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "PROYECTO"."TRIG_ID_CLIENTE" 
BEFORE INSERT ON CLIENTE
FOR EACH ROW
BEGIN
    SELECT MAX(ID_CLIENTE) + 1 INTO :NEW.ID_CLIENTE FROM CLIENTE;
    IF :NEW.ID_CLIENTE IS NULL THEN
        :NEW.ID_CLIENTE := 1; 
    END IF;
END;
/
ALTER TRIGGER "PROYECTO"."TRIG_ID_CLIENTE" ENABLE;
