--  DDL for Function GET_NEXT_DOMICILIO_ID
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "PROYECTO"."GET_NEXT_DOMICILIO_ID" ()
RETURN NUMBER
AS
BEGIN
  DECLARE
    last_id NUMBER;
  BEGIN
    SELECT MAX(id_domicilio) INTO last_id FROM domicilio;
    RETURN last_id + 1;
  END;
END;

